import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({

index:{
    alignItems:'center',
    backgroundColor:'#ffca3a',
    justifyContent:'center',
    height:800,
    
},

index1:{
    alignItems:'center',
    backgroundColor:'#ffca3a',
    height:300,
    justifyContent:'center',
    marginLeft:40,
},

indexImg:{
    alignItems:'center',  
},


dados:{
    alignItems:'center',
    backgroundColor:'#ffca3a',
    justifyContent:'center',
    height:800,
},

dadosText:{
    fontWeight:'bold',
    fontSize: 25,
    marginBottom:50,
},

dadosText1:{
    color:'#5C6B73',
    fontWeight:'100',
    fontSize: 25,
},

dadosImg:{
    height:150,
    width:300,
},
dadosTextInput:{
    borderColor:'#C2DFE3',
    borderStyle:'solid',
    borderWidth:1,
    margin:10,
},

dadosTouch:{
    alignItems:'center',
    backgroundColor:'#000',
    borderStyle:'solid',
    borderWidth:1,
    borderRadius:10,
    height:30,
    justifyContent:'center',
    marginTop:30,
    marginBottom:100,
    width:80,
},

dadosTouchText:{
    color:'#ff595e',
    fontSize:20,
    fontWeight:'bold',
},

safeAreaView:{
    alignItems:'center',
    backgroundColor:'red',
    flex:1,
    justifyContent:'center',
    height:1500,
},

scrollView:{
    backgroundColor:'yellow',
    flexGrow:1,
    height:700,
    width:380,
},

dicas:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    justifyContent:'center',
    height:800,

},
    
dicasImg:{
    height:100,
    width:100,
},

dicasText:{
    alignItems:'center',
    fontWeight:'bold',
    fontSize: 20,
    justifyContent:'center',
    marginLeft:70,
    width:400,
},

dicasText1:{
    alignItems:'center',
    fontSize: 15,
    justifyContent:'center',
    width:350,
},


dicasFlex:{
    backgroundColor:'green',
    flex:1,
    flexDirection: 'row',
    padding:30,
},

dicasFlex1:{
    backgroundColor:'#E0FBFC',
    flex:4,
    fontSize:18,
    fontWeight:'bold',
    height:300,
    padding:10,
},


dicasFlex2:{
    backgroundColor:'#E0FBFC',
    flex:3,
    height:150,
    marginTop:30,
    margin:10,
    
},

dicasImg:{
    alignItems:'center',
    justifyContent:'center',

},

form:{
    flexDirection:'row',
    alignItems:'center',
    justifyContent:'center',
},

formInput:{
    
    borderColor:'#C2DFE3',
    borderStyle:'solid',
    borderWidth:1,
    width:150,
    margin:10,


},

formText1:{
    color:'#5C6B73',
    fontWeight:'100',
    fontSize: 20,
},

formText2:{
    borderColor:'#C2DFE3',
    borderWidth:1,
    borderStyle:'solid',
    color:'#5C6B73',
    fontWeight:"bold",
    fontSize: 20,
    margin:20,
},



formTouch:{
    alignItems:'center',
    backgroundColor:'#5C6B73',
    borderStyle:'solid',
    borderWidth:1,
    borderRadius:10,
    height:30,
    justifyContent:'center',
    marginTop:30,
    marginBottom:100,
    width:150,
},


formTouchText:{
  
    color:'#E0FBFC',
    fontSize:20,
    fontWeight:'bold',
    marginBottom:5,

},


})
